				const html = updateImageReferences("<p>The configuration object is passed to the chart after an instance of it has been inserted into the DOM. The config provides:</p>\n<ul>\n<li>Time frame</li>\n<li>Layout definition</li>\n<li>Optionally\n<ul>\n<li>Datasets - price, indicators, drawings</li>\n<li>Theme</li>\n</ul>\n</li>\n</ul>\n<h2 id=\"defining-and-starting-the-chart\">Defining and Starting the Chart</h2>\n<pre is:raw=\"\" class=\"astro-code min-dark\" style=\"background-color: #1f1f1f; overflow-x: auto; white-space: pre-wrap; word-wrap: break-word;\" tabindex=\"0\"><code><span class=\"line\"><span style=\"color: #F97583\">import</span><span style=\"color: #B392F0\"> { Chart } </span><span style=\"color: #F97583\">from</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">'tradex-chart'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #6B737C\">// After the chart has mounted on the DOM,</span></span>\n<span class=\"line\"><span style=\"color: #6B737C\">// Start it with a configuration object</span></span>\n<span class=\"line\"><span style=\"color: #79B8FF\">chart</span><span style=\"color: #B392F0\">.start(config)</span></span></code></pre>\n<h2 id=\"minimal-config\">Minimal Config</h2>\n<p>Config describes the basics of the chart, size, ect. It requires the following minimum properties to be valid:</p>\n<pre is:raw=\"\" class=\"astro-code min-dark\" style=\"background-color: #1f1f1f; overflow-x: auto; white-space: pre-wrap; word-wrap: break-word;\" tabindex=\"0\"><code><span class=\"line\"><span style=\"color: #F97583\">import</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">*</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F97583\">as</span><span style=\"color: #B392F0\"> talib </span><span style=\"color: #F97583\">from</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">'./node_modules/talib-web/lib/index.esm'</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #6B737C\">// minimal config</span></span>\n<span class=\"line\"><span style=\"color: #F97583\">const</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">config</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F97583\">=</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  title</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"BTC/USDT\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  talib</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> talib</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// talib: `${window.location.origin}/talib.wasm`</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">}</span></span></code></pre>\n<p><code>title</code> is required so you know what asset you are looking at.</p>\n<p><code>talib</code> is a pointer to the <a href=\"https://https//anchegt.github.io/talib-web/\">talib-web</a> technical indicator library compiled as a WebAssembly module. TradeX-chart will take care of instantiating it.</p>\n<aside aria-label=\"Caution\" class=\"starlight-aside starlight-aside--caution\"><p class=\"starlight-aside__title\" aria-hidden=\"true\"><svg viewBox=\"0 0 24 24\" width=\"16\" height=\"16\" fill=\"currentColor\" class=\"starlight-aside__icon\"><path d=\"M12 16C11.8022 16 11.6089 16.0587 11.4444 16.1686C11.28 16.2784 11.1518 16.4346 11.0761 16.6173C11.0004 16.8001 10.9806 17.0011 11.0192 17.1951C11.0578 17.3891 11.153 17.5673 11.2929 17.7071C11.4327 17.847 11.6109 17.9422 11.8049 17.9808C11.9989 18.0194 12.2 17.9996 12.3827 17.9239C12.5654 17.8482 12.7216 17.72 12.8315 17.5556C12.9413 17.3911 13 17.1978 13 17C13 16.7348 12.8946 16.4805 12.7071 16.2929C12.5196 16.1054 12.2652 16 12 16ZM22.67 17.47L14.62 3.47003C14.3598 3.00354 13.9798 2.61498 13.5192 2.3445C13.0586 2.07401 12.5341 1.9314 12 1.9314C11.4659 1.9314 10.9414 2.07401 10.4808 2.3445C10.0202 2.61498 9.64019 3.00354 9.38 3.47003L1.38 17.47C1.11079 17.924 0.966141 18.441 0.960643 18.9688C0.955144 19.4966 1.089 20.0166 1.34868 20.4761C1.60837 20.9356 1.9847 21.3185 2.43968 21.5861C2.89466 21.8536 3.41218 21.9964 3.94 22H20.06C20.5921 22.0053 21.1159 21.8689 21.5779 21.6049C22.0399 21.341 22.4234 20.9589 22.689 20.4978C22.9546 20.0368 23.0928 19.5134 23.0895 18.9814C23.0862 18.4493 22.9414 17.9277 22.67 17.47ZM20.94 19.47C20.8523 19.626 20.7245 19.7556 20.5697 19.8453C20.4149 19.935 20.2389 19.9815 20.06 19.98H3.94C3.76111 19.9815 3.5851 19.935 3.43032 19.8453C3.27553 19.7556 3.14765 19.626 3.06 19.47C2.97223 19.318 2.92602 19.1456 2.92602 18.97C2.92602 18.7945 2.97223 18.622 3.06 18.47L11.06 4.47003C11.1439 4.30623 11.2714 4.16876 11.4284 4.07277C11.5855 3.97678 11.766 3.92599 11.95 3.92599C12.134 3.92599 12.3145 3.97678 12.4716 4.07277C12.6286 4.16876 12.7561 4.30623 12.84 4.47003L20.89 18.47C20.9892 18.6199 21.0462 18.7937 21.055 18.9732C21.0638 19.1527 21.0241 19.3312 20.94 19.49V19.47ZM12 8.00003C11.7348 8.00003 11.4804 8.10538 11.2929 8.29292C11.1054 8.48046 11 8.73481 11 9.00003V13C11 13.2652 11.1054 13.5196 11.2929 13.7071C11.4804 13.8947 11.7348 14 12 14C12.2652 14 12.5196 13.8947 12.7071 13.7071C12.8946 13.5196 13 13.2652 13 13V9.00003C13 8.73481 12.8946 8.48046 12.7071 8.29292C12.5196 8.10538 12.2652 8.00003 12 8.00003Z\"></path></svg>Caution</p><section class=\"starlight-aside__content\"><p>Depending upon the server configuration, <code>.wasm</code> files might be served with an incorrect mime type when loaded from a subdirectory.<br>\nIf that is the case, copy <code>tablib.wasm</code> from <code>./modules/talib-web/lib/</code> to the web server root, and reference it in the config as following:<br>\n<code>talib: `${window.location.origin}/talib.wasm` </code></p></section></aside>\n<h2 id=\"basic-config\">Basic Config</h2>\n<p><code>height</code> and <code>width</code> default to 100% of the parent element’s height and width if not defined in the config. <code>height</code> and <code>width</code> are the number of pixels. The chart has a minimal height <code>300</code> and width of <code>400</code> pixels.</p>\n<p><code>rangeLimit</code> defines the initial number of candles to display. It is treated as the “zoom” level of the timeline.</p>\n<p><a href=\"#config-object-options\">Config Object Options</a> provides a complete overview of all settings.</p>\n<h2 id=\"state\">State</h2>\n<p>State is a snapshot of the entirety of the chart data state, including chart price data, indicators, drawing tools, datasets and theme. Where properties of Config and <code>state.settings</code> overlap, Config properties take priority.</p>\n<p>Chart states can be loaded (swapped) as desired. By default the chart can hold multiple states in memory.</p>\n<p>The chart state can be exported to be reused later.</p>\n<pre is:raw=\"\" class=\"astro-code min-dark\" style=\"background-color: #1f1f1f; overflow-x: auto; white-space: pre-wrap; word-wrap: break-word;\" tabindex=\"0\"><code><span class=\"line\"><span style=\"color: #79B8FF\">chart</span><span style=\"color: #B392F0\">.</span><span style=\"color: #79B8FF\">state</span><span style=\"color: #B392F0\">.export(key)</span></span></code></pre>\n<p>More information the chart data state are found in the <a href=\"../state\">state documentation</a> .</p>\n<h2 id=\"range\">Range</h2>\n<p>Range determines the initial start and end timestamps for the price history (candles) that the chart displays.</p>\n<p>Refer to <a href=\"../range#initial-range-config\">Initial Range Config</a> for more detail.</p>\n<h2 id=\"themes\">Themes</h2>\n<p>For API methods to manipulate chart themes refer to <a href=\"../themes\">themes</a></p>\n<h3 id=\"candle-types\">Candle Types</h3>\n<pre is:raw=\"\" class=\"astro-code min-dark\" style=\"background-color: #1f1f1f; overflow-x: auto; white-space: pre-wrap; word-wrap: break-word;\" tabindex=\"0\"><code><span class=\"line\"><span style=\"color: #F97583\">export</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F97583\">const</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">CandleType</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F97583\">=</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  CANDLE_SOLID</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">'candle_solid'</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  CANDLE_HOLLOW</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">'candle_hollow'</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  CANDLE_UP_HOLLOW</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">'candle_up_hollow'</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  CANDLE_DOWN_HOLLOW</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">'candle_down_hollow'</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  OHLC</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">'ohlc'</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  AREA</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">'area'</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  LINE</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">'line'</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">}</span></span></code></pre>\n<p>Refer to <a href=\"themes#candle-types\">Candle Type Theme</a> for visual examples of each candle type.</p>\n<h1 id=\"config-object-options\">Config Object Options</h1>\n<p>More detailed configuration options not included below:</p>\n<ul>\n<li><a href=\"../range/#intial-range-config\">Initial Range Config</a></li>\n<li><a href=\"../themes/#theme-properties\">Theme Properties</a></li>\n</ul>\n<pre is:raw=\"\" class=\"astro-code min-dark\" style=\"background-color: #1f1f1f; overflow-x: auto; white-space: pre-wrap; word-wrap: break-word;\" tabindex=\"0\"><code><span class=\"line\"><span style=\"color: #F97583\">const</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">config</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F97583\">=</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  id</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"TradeX_test\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  title</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"BTC/USDT\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// width and height are pixel values.</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// if none are provided, the chart will responsively resize to the parent element that contains it</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  width</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">1000</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  height</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">800</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// utils bar config</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  utils</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {}</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// tools bar config</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  tools</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {}</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// timeframes: s, m, h, d, M, y</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  timeFrame</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"1m\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// initial Range Config</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  range</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    </span><span style=\"color: #6B737C\">// see documentation Range, Initial Range Config</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  }</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// chart theme - see Theme Properties for more detail</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  theme: {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    candle</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// candle types: 'candle_hollow','candle_up_hollow','candle_down_hollow','ohlc','area','line'</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      Type</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"candle_solid\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      AreaLineColour</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#4c5fe7\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      AreaFillColour</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> [</span><span style=\"color: #FFAB70\">\"#4c5fe780\"</span><span style=\"color: #BBBBBB\">,</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#4c5fe700\"</span><span style=\"color: #B392F0\">]</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      UpBodyColour</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#00F04088\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      UpWickColour</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#0F4\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      DnBodyColour</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#F0004088\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      DnWickColour</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#F04\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    volume</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      Height</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">15</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      UpColour</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#00F04044\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      DnColour</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#F0004044\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    xAxis</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      colourTick</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#6a6f80\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      colourLabel</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#6a6f80\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      colourCursor</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#2A2B3A\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      colourCursorBG</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#aac0f7\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// fontFamily: XAxisStyle.FONTFAMILY,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// fontSize: XAxisStyle.FONTSIZE,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// fontWeight: XAxisStyle.FONTWEIGHT,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// line: \"#656565\"</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      slider</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#586ea6\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      handle</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#586ea688\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      tickMarker</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">false</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    yAxis</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      colourTick</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#6a6f80\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      colourLabel</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#6a6f80\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      colourCursor</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#2A2B3A\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      colourCursorBG</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#aac0f7\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// fontFamily: YAxisStyle.FONTFAMILY,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// fontSize: YAxisStyle.FONTSIZE,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// fontWeight: YAxisStyle.FONTWEIGHT,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// line: \"#656565\"</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      tickMarker</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">false</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      location</span><span style=\"color: #F97583\">:</span><span style=\"color: #FFAB70\">\"left\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    chart</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      Background</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#141414\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      BorderColour</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#666\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      GridColour</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#333\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      TextColour</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #FFAB70\">\"#ccc\"</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    primaryPane</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    secondaryPane</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    tools</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// tool bar locations: \"left\", \"right\", false - defaults to left</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      location</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">false</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    utils</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// utils bar locations: false - defaults to true</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      location</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">false</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    time</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// timeline navigation: false - defaults to true</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      navigation</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">false</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    legend</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// legend controls: false - defaults to true</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// display icons, order, visible, remove, config</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      controls</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">false</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      </span><span style=\"color: #6B737C\">// default text colour</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">      colour: </span><span style=\"color: #FFAB70\">\"#96a9db\"</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    }</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// used for chart data validation, timestamps compared against BTC genisis block</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  isCrypto</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">true</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// enable console.log output - WARNING! my impact performance</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  logs</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">false</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// enable console.info output - WARNING! my impact performance</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  infos</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">true</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// enable console.warning output - WARNING! my impact performance</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  warnings</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">true</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// enable console.error output - WARNING! my impact performance</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  errors</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">true</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// enable live updates for a price stream</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  stream</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {}</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// maximum rate in milliseconds that a live stream should be REDRAWN, does not throttle actual stream rate</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  maxCandleUpdate</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #F8F8F8\">250</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// pointer to talib-web library, required if you want to see indicators</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  talib</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> talib</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// file path (relative to server document root) for the talib-web .wasm file</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// required if you want to see indicators</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  wasm</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> wasm</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// initial data sate provided to the chart, price history, indicators, datasets</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// is optional - chart will start without one, and await data via the API</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  state</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    </span><span style=\"color: #6B737C\">// Details of the state structure are found in [state](state)</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  }</span><span style=\"color: #BBBBBB\">,</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  </span><span style=\"color: #6B737C\">// user defined functions to run with or replace default methods</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  callbacks</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">    indicatorSettings</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> {fn</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> (c)</span><span style=\"color: #F97583\">=></span><span style=\"color: #B392F0\">{ alert(</span><span style=\"color: #79B8FF\">c</span><span style=\"color: #B392F0\">.id) }</span><span style=\"color: #BBBBBB\">,</span><span style=\"color: #B392F0\"> own</span><span style=\"color: #F97583\">:</span><span style=\"color: #B392F0\"> </span><span style=\"color: #79B8FF\">true</span><span style=\"color: #B392F0\">}</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">  }</span></span>\n<span class=\"line\"><span style=\"color: #B392F0\">}</span></span></code></pre>");

